import "../src/App.css";
import Tasks from "./components/Tasks";

function App() {
  return (
    <div className="App">
      <div className="form">
        <h1>Todo List</h1>
        <Tasks />
      </div>
      <ul></ul>
    </div>
  );
}

export default App;
